(9, 'Contato', 'Entre em Contato', '<h3>Fale Conosco</h3>\n\n<p>&nbsp;</p>\n\n<form action="envia_form.php" method="post" name="form1" target="_self">\n<input type="hidden" name="assunto" value="Contato do Site">\n<table align="center" border="0" cellpadding="1" cellspacing="1" style="width:90%">\n	<tbody>\n		<tr>\n			<td>Nome :</td>\n			<td><input name="nome" size="50" type="text" /></td>\n		</tr>\n		<tr>\n			<td>Telefone :</td>\n			<td><input name="fone" size="50" type="text" /></td>\n		</tr>\n		<tr>\n			<td>email:</td>\n			<td><input name="email" size="50" type="text" /></td>\n		</tr>\n		<tr>\n			<td colspan="2">Mensagem :</td>\n		</tr>\n		<tr>\n			<td colspan="2"><textarea cols="100" name="mensagem" rows="10"></textarea></td>\n		</tr>\n	</tbody>\n</table>\n<input type="submit">\n</form>\n', 'index.php?q=9'),
(10, 'Empresa', 'Conhea nossa empresa', '<h3>Sobre a Nossa Empresa</h3>\r\n\r\n<hr />\r\n<table align="center" border="0" cellpadding="1" cellspacing="1" style="width:800px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style="text-align:justify">A &nbsp;&eacute; uma empresa devidamente constitu&iacute;da e voltada ao ramo imobili&aacute;rio, direcionadaexclusivamente aos clientes interessados na loca&ccedil;&atilde;o, venda, administra&ccedil;&atilde;o de im&oacute;veis ou assessoria jur&iacute;dica,nossa empresaconta com uma grande estrutura atrav&eacute;s de softwares e sistemas espec&iacute;ficos como fim de acelerar, agilizare otimizaro processo de loca&ccedil;&atilde;o e venda doseu im&oacute;vel, sendo este processo de ampla intera&ccedil;&atilde;o juntoadiversas redes sociais e meios de comunica&ccedil;&otilde;esno qual quefar&atilde;o com que seu im&oacute;vel esteja sempre vis&iacute;vel e dispon&iacute;vel a grande demanda de clientes, hojeexistentes no mercado imobili&aacute;rio, desta forma, reduzindo consideravelmente o tempo de espera entre as loca&ccedil;&atilde;o e vendas de im&oacute;veis.</p>\r\n\r\n			<p style="text-align:justify">&Aacute; &nbsp;conta com sua equipe de corretores credenciados, treinadose orientados exclusivamente para atender todos os clientes poss&iacute;veis, independentemente de regi&atilde;o, uma vez, que o intenso investimento em canais de comunica&ccedil;&atilde;o, marketing e publicidade nos possibilita desempenhar um trabalho de alta qualidade em diversas regi&otilde;es da cidade.</p>\r\n\r\n			<p style="text-align:justify">MISS&Atilde;O: Vender, alugar ou administrar seu im&oacute;vel com rapidez e agilidade, usando e abusando de mecanismos no qual nos possibilite estar sempre em primeiro lugar, quando a procura ou a inten&ccedil;&atilde;o de cada pretendente estiver relacionada de alguma forma ao mercado imobili&aacute;rio.</p>\r\n\r\n			<p style="text-align:justify">VIS&Atilde;O: Estar sempre atento as novas tecnologias que o mercado disponibiliza, aderir a todas as ferramentas poss&iacute;veis, afim que a intera&ccedil;&atilde;o de nossa empresa seja cada vez mais marcante e conhecida dentro do nosso ramo de atividade, estar atentos as frequentes mudan&ccedil;as de cen&aacute;rios, estar sempre atualizados, e o principal, n&atilde;o ter medo de mudar se for necess&aacute;rio, o medo &eacute; uma barreira no qual impede o crescimento e a evolu&ccedil;&atilde;o de v&aacute;rias pessoas e organiza&ccedil;&otilde;es.</p>\r\n\r\n			<p style="text-align:justify">VALORES: A transpar&ecirc;ncia de cada negocio e de cada informa&ccedil;&atilde;o, prazos foram estipulados para serem cumpridos, imprevistos acontecem, nenhum neg&oacute;cio pode ser fechado sem margem de erros ou com condi&ccedil;&otilde;es que alterem o seu percurso. Estes s&atilde;o fatores que sempre lembraremos, porem, vamos fazer de tudo para evita-los, n&atilde;o pouparemos suor e determina&ccedil;&atilde;o.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align="center">\r\n			<p><img src="http://www.sgifacil.com.br/img/exija_creci.jpg" style="height:100px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'index.php?q=10'),
(11, 'Cadastre', 'Cadastre seu Imvel Conosco', '<h3>Cadastre seu im&oacute;vel conosco</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<form action="envia_form.php" method="post" name="form1" target="_self"><input name="assunto" type="hidden" value="Cliente Solicita Cadastro de imovel" />\r\n<table align="center" border="0" cellpadding="1" cellspacing="1" style="width:90%">\r\n	<tbody>\r\n		<tr>\r\n			<td>Nome :</td>\r\n			<td><input name="nome" size="50" type="text" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Telefone :</td>\r\n			<td><input name="fone" size="50" type="text" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>email:</td>\r\n			<td><input name="email" size="50" type="text" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2">Endere&ccedil;o completo e descri&ccedil;&atilde;o do Im&oacute;vel :</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2"><textarea cols="100" name="mensagem" rows="10"></textarea></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<input type="submit" name="enviar" value="Enviar"/>\r\n</form>', 'index.php?q=11'),
(12, 'Localizao', 'Localizacao', '<p>&nbsp;</p>\r\n\r\n<div><iframe frameborder="no" height="300" src="abre_mapa.php?endereco=Av. Pau Brasil, 122, Cidade das Flores, Osasco, SP" width="300"></iframe>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '12');
