ul>\r\n<ul><strong>Sociais</strong>\r\n<li onclick="window.open(''http://facebook.com/'',''_blank'');">Facebook</li>\r\n<li onclick="window.open(''http://plus.google.com/'',''_blank'');">Goole +</li>\r\n<li onclick="window.open(''http://linkedin.com/'',''_blank'');">Linked In</li>\r\n<li onclick="window.open(''http://twitter.com/'',''_blank'');">Twitter</li>\r\n</ul>\r\n<ul><strong>Para Voc</strong>\r\n<li onclick="window.open(''index.php?q=Fav'',''_self'');">Entrar</li>\r\n<li onclick="window.open(''index.php?q=Fav'',''_self'');">Meus dados</li>\r\n<li onclick="window.open(''index.php?q=Fav'',''_self'');">Imveis Favoritos</li>\r\n</ul>\r\n<ul><strong>Adm Site</strong>\r\n<li onclick="window.open(''http://sgiplus.com.br'',''_blank'');">Adm</li>\r\n<li onclick="window.open(''http://sgiplus.com.br:2095'',''_blank'');">Webmail</li>\r\n</ul>\r\n</nav>\r\n</div>\r\n<br>\r\n<footer style="padding: 30px;font-size: 18px;">\r\n<strong>\r\n<br>CONTATO:\r\n<br>www.sgifacil.com.br\r\n<br>suporte@sgifacil.com.br\r\n</strong>\r\n<p align="right">\r\n<img src="img/facebook.png" width="30">\r\n<img src="img/twitter.png" width="30">\r\n<img src="img/youtube.png" width="30">\r\n<img src="img/googleplus.png" width="30">\r\n</p>\r\n</footer>\r\n<div class="rodape-fixa">\r\n<table align="center">\r\n<tr>\r\n<td width="330">\r\n<a href="mailto: vendas@sgifacil.com.br" target="_blank"><font color="#2e2f2f">vendas@sgifacil.com.br</font></a>\r\n</td>\r\n<td width="330">\r\n<img src="http://www.sgiplus.com.br/site/fotos/0002/54326b4d238190f5445df9c7920d7f1e.jpg" style="margin-top: -20px;">\r\n</td>\r\n<td width="330"><font color="#2e2f2f">\r\n(11) 4191-1896\r\n</td>\r\n</tr>\r\n</table>\r\n</div>', '#rodape {\r\n    clear: both;\r\n    position: relative;\r\n    width: 100%;\r\n    height: auto;\r\n    border-top: 3px solid #fff;\r\n    z-index: 110;\r\n}\r\n\r\n#rodape ul {\r\n    padding: 30px;\r\n    float: left;\r\n    margin: 20px;\r\n    list-style: none;\r\n}\r\n\r\n#rodape li {\r\n  